class Node:
    def __init__(self, index, total_cost, h_cost, g_cost, tickets ,transporte = None, parent = None):
        self.index = index                    # Lista de agentes
        self.total_cost = total_cost          # Soma dos 3
        self.h_cost = h_cost                  # Lista de heuristicas
        self.g_cost = g_cost                  # Lista de custos
        self.transporte = transporte          # Lista de transportes
        self.parent = parent                  # Nó pai
        self.tickets = list(tickets)
        self.depth = 0 if parent is None else parent.depth + 1

class SearchProblem:

    def __init__(self, goal, model, auxheur = []):
        self.goal = goal
        self.model = model
        self.auxheur = auxheur
        self.limitexp = None
        self.limit_depth = None
        self.number_expansions = None

    def get_heuristic(self, index1, index2):
        return matrix[index1 - 1][index2 - 1]

    def get_total(self, node):
        return node.total_cost

    def sort_by_total(self, lis):
        lis.sort(key = self.get_total)

    def get_adjacents(self, pos):
        return self.model[pos]

    def create_node_three(self, node, la, lb, lc):
        h = []
        g = []
        total = 0
        h.append(self.get_heuristic(la[1], self.goal[0]))
        total += h[0]
        h.append(self.get_heuristic(lb[1], self.goal[1]))
        total += h[1]
        h.append(self.get_heuristic(lc[1], self.goal[2]))
        total += h[2]

        for i in node.g_cost:
            g.append(i+1)
            #total += i+1


        return Node([la[1],lb[1],lc[1]], total, h, g, node.tickets,[la[0],lb[0],lc[0]], node)

    def create_node_one(self, node, l):
        h = self.get_heuristic(l[1], self.goal[0])
        g = node.g_cost[0] + 1
        return Node([l[1]],h , [h], [g], node.tickets,[l[0]], node)

    def check_tickets(self, node):
        for i in node.transporte:
            if node.tickets[i] < 0:
                return True
        return False

    def check_collision(self, node):
        l = node.index
        return len(l) != len(set(l))

    def check_in_advance(self, node):
        arrived = [False, False, False]
        for i in range(len(node.index)):
            if node.index[i] == self.goal[i]:
                arrived[i] = True
        return len(set(arrived)) != 1

    def reconstruct_path(self, node):
        path = []
        while node.parent != None:
            path.append([node.transporte, node.index])
            node = node.parent
        path.append([[], node.index])
        path.reverse()
        return path

    def search(self, init, limitexp = 2000, limitdepth = 10, tickets = [math.inf,math.inf,math.inf], anyorder = False):
        self.limitexp = 2000
        self.limit_depth = limitdepth
        self.number_expansions = 0

        queue = []
        #expanded = []
        heuristica = []
        newGoal = []
        g = []
        total = 0

        # Criar as listas para o nó inicial (heuristica e custo(g))
        if anyorder:
            for j in range(len(init)):
                minH = self.get_heuristic(init[j], self.goal[0])
                minG = 0
                for go in range(len(self.goal) - 1):
                    if self.get_heuristic(init[j], self.goal[go + 1]) < minH:
                        minG = go + 1
                        minH = self.get_heuristic(init[j], self.goal[minG])
                heuristica.append(self.get_heuristic(init[j], self.goal[minG]))
                newGoal.append(minG)
                g.append(0)
                total += heuristica[j]
            self.goal = newGoal
        else:
            for j in range(len(init)):
                heuristica.append(self.get_heuristic(init[j], self.goal[j]))
                g.append(0)
                total += heuristica[j]

        # Criar o nó inicial
        initial = Node(init, total, heuristica, g, tickets)
        print(self.goal)
        queue.append(initial)

        current_node = initial
        #agente = 0
        while (len(queue) != 0):
            #agente = agente % 3
            #print("expandi para este: ", current_node.index)
            self.number_expansions += 1

            if current_node.index == self.goal:
                return self.reconstruct_path(current_node)

            all_adjacentes = []

            # Buscar os adjacentes
            for i in current_node.index:
                all_adjacentes.append(self.get_adjacents(i))


            # Gerar todas as combinações do próximo passo:
            if len(init) > 1:
                # Para 3 agentes
                for a in all_adjacentes[0]:
                    for b in all_adjacentes[1]:
                        for c in all_adjacentes[2]:
                            queue.append((self.create_node_three(current_node, a, b, c)))
            else:
                # Para 1 agente
                for k in all_adjacentes[0]:
                    queue.append(self.create_node_one(current_node, k))

            # Agora que já tenho todas as combinações do próximo passo, vou procurar a solução ótima
            queue.remove(current_node)
            self.sort_by_total(queue)
            # Escolher o melhor caminho
            current_node = queue[0]

            while True:
                if current_node.depth > self.limit_depth:
                    queue.remove(current_node)
                    current_node = queue[0]
                    continue

                if self.number_expansions > self.limitexp:
                    queue.remove(current_node)
                    current_node = queue[0]
                    continue

                # Usam os bilhetes
                for l in current_node.transporte:
                    current_node.tickets[l] -= 1

                if self.check_tickets(current_node):
                    # Escolher o segundo melhor caminho
                    queue.remove(current_node)
                    current_node = queue[0]
                    continue

                # Verificar colisão
                # Só se aplica a mais so que 1 agente
                if len(init) > 1:
                    if self.check_collision(current_node):
                        # Escolher segundo melhor caminho
                        queue.remove(current_node)
                        current_node = queue[0]
                        continue

                # Verificar se alguém chegou antes do tempo
                # Só se aplica a mais de 1 agente
                if len(init) > 1:
                    if self.check_in_advance(current_node):
                        queue.remove(current_node)
                        current_node = queue[0]
                        continue

                # Se passou todas as verificações quebramos o ciclo
                break
        return []



